import photo from '../../assets/img/my-photo.png';

export default function PersonalInfos(langague: string) {
    const json = {
        'pt-br': {
            name: 'Fabio Abreu',
            age: '24 anos',
            city: 'Caxias do Sul',
            state: 'Rio Grande do Sul - Brasil',
            photo: photo
        },
        'eng': {
            name: 'Fabio Abreu',
            age: '24 years old',
            city: 'Caxias do Sul',
            state: 'Rio Grande do Sul - Brazil',
            photo: photo
        }
    };

        if (langague == 'eng') {
            return json['eng'];
        }
        return json['pt-br'];
};
